import React from 'react';
import { Button, Modal } from 'react-bootstrap';
interface props {
    visible : boolean,
    closeModal : ()=>void;
}

function ModalMarket(props:props) {


    return (
        // <div style={{position:'absolute',marginTop: 10,}}>
        //     <>

                <Modal  show={props.visible} animation={true}  onHide={props.closeModal} style={styled.container}>
                    <a style={styled.buttonClose} onClick={props.closeModal}>
                        Close
                    </a>
                </Modal>
            // </>
        // </div>
    );
}
const  styled={
    container:{backgroundColor: 'whitesmoke',marginLeft: 700,marginTop:60,borderRadius:10},
    buttonClose:{
        // height: 20,
        padding:10,
        marginLeft: 10    }
}
export default ModalMarket;
